import React from "react";
import "./styles.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import Home from './Containers/Home';
import UserDetails from './Containers/UserForm';

export default function App() {
  return (
    <div className="App" id='app'>
        <Router>
      <div>
        <Switch>
          <Route path="/newuser">
            <UserDetails />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>

    </div>
  );
}


function About() {
  return <h2>About</h2>;
}
